import React from 'react';
import { withRouter } from 'react-router-dom';

import ReactWordcloud from 'react-wordcloud';

const Wordcloud = (props) => {
    const words = [
        {
          text: 'told',
          value: 64,
        },
        {
          text: 'mistake',
          value: 11,
        },
        {
          text: 'thought',
          value: 16,
        },
        {
          text: 'bad',
          value: 17,
        },
      ]
  return <ReactWordcloud words={words} />
}

export default withRouter(Wordcloud)
